    public function getSourceContext()
    {
        return new Source("{% block widget_content %}
    {% if response is defined %}
        {% set widgetResponse = {
            widget: {
                trigger: [{
                    eventBroker: 'widget',
                    name: 'formSave',
                    args: [response],
                }],
            }
        } %}

        {{ widgetResponse|json_encode|raw }}
    {% else %}
        <div class=\"{% block widget_content_class %}widget-content{% endblock %}\">
            {% block widget_content_inner %}
                {% block messages %}
                    {% if messages is defined and messages|length %}
                        {% for type, items in messages %}
                        <div class=\"alert alert-{{ type }}\" role=\"alert\">
                            <ul>
                                {% for item in items %}
                                    <li>{{ item }}</li>
                                {% endfor %}
                            </ul>
                        </div>
                        {% endfor %}
                    {% endif %}
                {% endblock %}
                {% block errors %}
                    {% if errors is defined and errors|length %}
                        <div class=\"alert alert-error\" role=\"alert\">
                            <ul>
                            {% block errors_inner %}
                                {% for error in errors %}
                                    <li>{{ error.message | trans(error.parameters|default([]))}}</li>
                                {% endfor %}
                            {% endblock %}
                            </ul>
                        </div>
                    {% endif %}
                {% endblock %}
                {% if form is defined %}
                    {% block form_errors %}
                        {% if form.vars.errors|length > 0 %}
                            <div class=\"alert alert-error\" role=\"alert\">
                                {% block form_errors_inner %}
                                    {{ form_errors(form) }}
                                {% endblock %}
                            </div>
                        {% endif %}
                    {% endblock %}

                    {% block form %}
